import React, { useState, useEffect, useRef } from 'react';
import { TOTP, Secret } from 'otpauth';
import { Copy, Check, ShieldAlert } from 'lucide-react';

export default function App() {
  const [secret, setSecret] = useState('');
  const [code, setCode] = useState('');
  const [error, setError] = useState('');
  const [copied, setCopied] = useState(false);
  const [progress, setProgress] = useState(100);
  const [timeLeft, setTimeLeft] = useState(30);

  const secretRef = useRef(secret);

  useEffect(() => {
    secretRef.current = secret;
  }, [secret]);

  const updateCode = () => {
    const currentSecret = secretRef.current;
    if (!currentSecret) {
      setCode('');
      setError('');
      return;
    }

    const cleanSecret = currentSecret.replace(/\s+/g, '').toUpperCase();
    try {
      const totp = new TOTP({
        secret: Secret.fromBase32(cleanSecret),
        algorithm: 'SHA1',
        digits: 6,
        period: 30,
      });
      setCode(totp.generate());
      setError('');
    } catch (err) {
      setCode('');
      setError('Invalid Base32 secret');
    }
  };

  useEffect(() => {
    let animationFrameId: number;
    let lastPeriod = -1;

    const tick = () => {
      const now = Date.now();
      const periodMs = 30000;
      const currentPeriod = Math.floor(now / periodMs);
      const timeElapsedInPeriod = now % periodMs;
      const remainingMs = periodMs - timeElapsedInPeriod;

      setProgress((remainingMs / periodMs) * 100);
      setTimeLeft(Math.ceil(remainingMs / 1000));

      if (currentPeriod !== lastPeriod) {
        lastPeriod = currentPeriod;
        updateCode();
      }

      animationFrameId = requestAnimationFrame(tick);
    };

    animationFrameId = requestAnimationFrame(tick);
    return () => cancelAnimationFrame(animationFrameId);
  }, []);

  useEffect(() => {
    updateCode();
  }, [secret]);

  const handleCopy = async () => {
    if (!code) return;
    try {
      await navigator.clipboard.writeText(code);
      setCopied(true);
      setTimeout(() => setCopied(false), 2000);
    } catch (err) {
      console.error('Failed to copy', err);
    }
  };

  return (
    <div className="min-h-screen flex flex-col items-center justify-center p-6 relative overflow-hidden">
      {/* Background glow */}
      <div className="absolute top-1/2 left-1/2 -translate-x-1/2 -translate-y-1/2 w-[600px] h-[600px] bg-[#00FF00]/5 rounded-full blur-[100px] pointer-events-none" />

      <div className="w-full max-w-lg z-10 flex flex-col items-center gap-12">
        {/* Logo */}
        <img 
          src="data:image/png;base64," 
          alt="Brand Logo" 
          className="max-w-[150px] h-auto opacity-80 mix-blend-screen"
          referrerPolicy="no-referrer"
        />

        {/* Header */}
        <div className="text-center space-y-2 -mt-4">
          <h1 className="text-3xl font-bold tracking-widest uppercase text-zinc-100">
            Instant TOTP
          </h1>
          <p className="text-zinc-900 dark:text-white text-sm tracking-widest uppercase">
            Zero Storage  Zero Logging
          </p>
        </div>

        {/* Input Section */}
        <div className="w-full relative">
        <input
  type="text"
  value={secret}
  onChange={(e) => setSecret(e.target.value)}
  placeholder="Paste Secret Key..."
  className="w-full bg-transparent border-b-2 outline-none text-center text-xl tracking-widest pb-2 transition-colors text-white placeholder-zinc-500 border-zinc-500 focus:border-zinc-300"
  autoComplete="off"
  spellCheck="false"
/>
          {error && secret && (
            <div className="absolute -bottom-8 left-0 right-0 flex items-center justify-center gap-2 text-red-500/80 text-sm">
              <ShieldAlert size={14} />
              <span>{error}</span>
            </div>
          )}
        </div>

        {/* Code Display Section */}
        <div className="h-48 flex flex-col items-center justify-center relative w-full">
          {code ? (
            <div className="relative group flex items-center justify-center">
              <div
                className="text-6xl sm:text-8xl font-black tracking-[0.1em] sm:tracking-[0.2em] text-[#00FF00] drop-shadow-[0_0_15px_rgba(0,255,0,0.3)] cursor-pointer select-all"
                onClick={handleCopy}
              >
                {code.slice(0, 3)} {code.slice(3)}
              </div>
              
              <button
                onClick={handleCopy}
                className="absolute -right-4 sm:-right-12 top-1/2 -translate-y-1/2 p-2 text-zinc-600 hover:text-[#00FF00] transition-colors opacity-0 group-hover:opacity-100"
                title="Copy to clipboard"
              >
                {copied ? <Check size={24} className="text-[#00FF00]" /> : <Copy size={24} />}
              </button>
            </div>
          ) : (
            <div className="text-zinc-100 text-5xl sm:text-7xl font-black tracking-[0.2em] select-none">
              000 000
            </div>
          )}
        </div>

        {/* Timer Progress */}
        {code && (
          <div className="w-full max-w-xs space-y-3">
            <div className="flex justify-between text-xs font-mono text-zinc-500 uppercase tracking-widest">
              <span>Valid for</span>
              <span className={timeLeft <= 5 ? 'text-red-500 animate-pulse' : 'text-[#00FF00]'}>
                {timeLeft}s
              </span>
            </div>
            <div className="h-1 w-full bg-zinc-900 rounded-full overflow-hidden">
              <div
                className={`h-full transition-none ${
                  timeLeft <= 5 ? 'bg-red-500' : 'bg-[#00FF00]'
                }`}
                style={{ width: `${progress}%` }}
              />
            </div>
          </div>
        )}
      </div>
    </div>
  );
}
